import pika
admin = {
		"host": "192.168.82.101",
		"username": "guest",
		"password": "guest",
		"vhost": "/",
		"port": "5672"
}
#data:image/jpeg;base64,
base64 = ""

credentials = pika.PlainCredentials(username=admin["username"],
										password=admin["password"],
										erase_on_connect=False)
# connect parameters
connect_params = pika.ConnectionParameters(admin["host"],
                                        admin["port"],
                                        admin["vhost"],
                                        credentials)

import json
connection = pika.BlockingConnection(connect_params)
channel = connection.channel()
channel.exchange_declare(exchange='Face', exchange_type='direct')
# data = {"image": "bXkgbmFtZSBpcyBtaW5o"}
data = {"image": base64}
message = json.dumps(data)
# message = "hello minh"
# channel.queue_declare(queue='q_detect')
for _ in range(1):
    channel.basic_publish(exchange="Face",
						routing_key="detect_key",
						body=message)

connection.close()